(56, 'page_privacy', '<p>This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p>\r\n\r\n<p>We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy. This Privacy Policy has been created with the help of the&nbsp;<a href=\"https://www.termsfeed.com/privacy-policy-generator/\" target=\"_blank\">Privacy Policy Generator</a>.</p>\r\n\r\n<h3>INFORMATION COLLECTED WHILE USING THE APPLICATION</h3>\r\n\r\n<p>While using Our Application, in order to provide features of Our Application, We may collect, with Your prior permission:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Information regarding your location</p>\r\n	</li>\r\n	<li>\r\n	<p>Pictures and other information from your Device&#39;s camera and photo library</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>We use this information to provide features of Our Service, to improve and customize Our Service. The information may be uploaded to the Company&#39;s servers and/or a Service Provider&#39;s server or it may be simply stored on Your device.</p>\r\n\r\n<p>You can enable or disable access to this information at any time, through Your Device settings.</p>\r\n'),
(57, 'help', ''),
(58, 'contact_address', '40 Wynford Dr Toronto ON Canada'),
(59, 'refund_policy', '<p>You can request a refund for an 6ixTaxi ride using your mobile app or by visiting the website. It&#39;s important to note that there are no guarantees you will receive the refund. You can only contact 6ixTaxi Technologies, describe the circumstances, and wait until they review your request and inform you about their decision.</p>\r\n'),
(60, 'rate_type', 'Flat');
